'use strict';core.confirm = class {constructor(){this.boxShadow = 'rgba(0, 0, 0, 0.380392)0px 0px 14px 0px';this.bgColor = 'white';this.action= function(){};this.message = '';this.txtColor= '#333';this.font= 'Helvetica, Arial';this.heading = '';this.elem= '';}create(){this.elem = `<divid="coreConfirm"style="background-color: ${this.bgColor}; position: fixed; left: calc(50% - 175px); top: calc(50% - 100px); z-index: 1000000; width: 350px; overflow: hidden; border-radius: 5px; box-shadow: ${this.boxShadow}; display: none;"><div style="color: ${this.txtColor};font-size: 20px;font-weight: 400;margin: auto;text-align: center">${this.heading}</div><div style="color: ${this.txtColor};font-size: 16px;font-weight: 400;margin: auto;text-align: center;padding: 10px">${this.message}</div><div style="padding:10px; height:55px"><div class="pull-left"><button id="coreConfirmConfirmButton" class="btn btn-primary">Confirm</button></div><div class="pull-right"><button id="coreConfirmCancelButton" class="btn btn-default">Cancel</button></div></div></div>`;}show(){var self = this;$('body').append(this.elem);$('#coreConfirm').fadeIn('fast',function(){$("#coreConfirmConfirmButton").click(function(){$.ajax({url : self.action});self.hide();});$("#coreConfirmCancelButton").click(function(){self.hide();});});}hide(){var self = this;$('#coreConfirm').fadeOut('fast',function(){self.destroy();});}destroy(){$('#coreConfirm').remove();}init(heading,message,action){this.heading = heading;this.message = message;this.action= action;this.create();this.show();}}
